import React, { useEffect, useState } from 'react';
import logo from '../../assets/Logo/Logo-Full-Light.png';
import { Link, matchPath, useLocation } from 'react-router-dom';
import { NavbarLinks } from '../../data/navbar-links';
import { useDispatch, useSelector } from 'react-redux';
import { AiOutlineShoppingCart } from "react-icons/ai";
import { ProfileDropDown  } from '../core/Auth/ProfileDropDown';
import { apiConnector } from '../../services/apiconnector';
import { categories } from '../../services/apis';
import { MdKeyboardArrowDown } from "react-icons/md";
import { logout } from '../../services/operations/authAPI';


const subLinks = [
    {
        title: "Java",
        path: "/catalog/java"
    },
    {
        title: "Web Development",
        path: "/catalog/web-development"
    }
]

const Navbar = () => {

    const instructor = "Instructor";

    const {token} = useSelector( (state) => state.auth);
    const {user} = useSelector( (state) => state.profile);
    const {totalItems} = useSelector( (state) => state.cart);

    const location = useLocation();

    const [ssubLinks, setSsubLinks]  = useState([]);

    const fetchSublinks = async() => {
        try{
            const result = await apiConnector("GET", categories.CATEGORIES_API);
            console.log("Printing Sublinks result:" , result);
            setSsubLinks(result.data.data);
        }
        catch(error) {
            console.log("Could not fetch the category list");
        }
    }


    useEffect( () => {
        fetchSublinks();
    },[] )



    const matchRoute = (route) => {
        return matchPath({path:route}, location.pathname);
    }


    // temporary logout handler
    const dispatch = useDispatch();
    const logoutHandler = () => {
        dispatch(logout());
    }


  return (
    <div className='flex h-14 justify-center items-center border-b-[1px] border-b-richblack-700'>
        <div className='flex items-center justify-between w-11/12 max-w-maxContent'>

            <Link to="/">
                <img src={logo} width={160} height={32}/>
            </Link>

            {/* Nav Links */}
            <nav>
                <ul className='flex gap-x-6 text-richblack-25 cursor-pointer'>
                    {
                        NavbarLinks.map( (link,index) => {
                            return (
                                <li key={index}>
                                    {
                                        link.title === "Catalog" ? (
                                                <div className='relative flex flex-row gap-1 items-center justify-center group'>
                                                    <p>{link.title}</p>
                                                    <MdKeyboardArrowDown />

                                                    <div className='invisible absolute left-[50%] top-[50%] z-10
                                                    translate-x-[-50%] translate-y-[30%] flex flex-col rounded-lg
                                                    bg-richblack-5 p-4 text-richblack-900 opacity-0 transition-all 
                                                    duration-200 group-hover:visible group-hover:opacity-100 lg:w-[275px]'>

                                                        <div className='invisible absolute left-[56%] top-0 bg-richblack-5 
                                                        rotate-45 w-6 h-6 rounded-sm opacity-0 translate-y-[-50%]
                                                        group-hover:visible group-hover:opacity-100'></div>

                                                        <div className='flex flex-col'>
                                                        {
                                                            subLinks.length ? (
                                                                subLinks.map( (subLink,index) => (
                                                                    <Link to={`${subLink.path}`} key={index} 
                                                                    className='py-2 px-3 rounded-md hover:bg-richblack-50'>
                                                                        {subLink.title}
                                                                    </Link>
                                                                ))
                                                            ) :  (<div></div>)

                                                        }
                                                        </div>

                                                    </div>

                                                </div>
                                            ) : (
                                            <Link to={link?.path}>
                                                <p className={`${matchRoute(link?.path) ? "text-yellow-25" : "text-richblack-25"}`}>
                                                    {link.title}
                                                </p>
                                            </Link>
                                        )
                                    }
                                </li>
                            );
                        })
                    }
                </ul>
            </nav>

            {/* login/signup/dashboard */}
            <div className='flex gap-x-4 items-center'>
                {
                    user && user?.accountType != instructor && (
                        <Link to="/dashboard/cart" className='relative'>
                            <AiOutlineShoppingCart />
                            {
                                totalItems > 0 && (
                                    <span>
                                        {totalItems}
                                    </span>
                                )
                            }
                        </Link>
                    ) 
                }
                {
                    token === null && (
                        <Link to="/login">
                            <button className='border border-richblack-700 bg-richblack-800 px-3 py-1
                            text-richblack-100 rounded-md'>
                                Log in
                            </button>
                        </Link>
                    )
                }
                {
                    token === null && (
                        <Link to="/signup">
                            <button className='border border-richblack-700 bg-richblack-800 px-3 py-1
                            text-richblack-100 rounded-md'>
                                Sign Up
                            </button>
                        </Link>
                    )
                }
                {
                    token != null && <ProfileDropDown/>
                }
            </div>


            {/* Temporary logout button */} 
            {/* <button onClick={logoutHandler} className='text-white font-semibold'>
                Logout
            </button> */}

        </div>
    </div>
  )
}

export default Navbar;
